import './App.css';
import { Routes, Route } from 'react-router-dom';
import Layout  from "./pages/Layout";
import About  from "./pages/About";
import Home  from "./pages/Home";
import Default  from "./pages/Default";
import Dashboard  from "./pages/Dashboard";
import { CssBaseline, Container, Typography, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    justifyContent: 'space-between', // Alinea los elementos en la parte superior derecha
    alignItems: 'center', // Alinea verticalmente los elementos en el centro
    paddingTop: theme.spacing(2), // Espacio superior
  },
}));
